import React, { Component } from 'react'
const axios = require('axios')

class Login extends Component {
    render() {
        return (
            <div>
                  <div>
                    <input
                      style={{
                        width: '400px',
                        height: '30px',
                        margin: '5px',
                        borderRadius: '5px'
                      }}
                      type="username"
                      placeholder="USERNAME"
                      onChange={this.handleInputValue('username')}
                    ></input>
                  </div>

                  <button
                    style={{
                      width: '200px',
                      height: '30px',
                      margin: '5px',
                      borderRadius: '5px',
                      backgroundColor: 'white'
                    }}
                    type="submit"
                  >
                    로그인
                  </button>


              </div>
          );

    }
}

export default Login;
